Mr. Skin is a website that specializes in locating, posting and rating instances of female nudity in television and film. Founded in August 1999, Mr. Skin is also the nickname of the company's chief executive, whose real name is Jim McBride.[1] As of 2007, MrSkin.com attracted more than seven million visitors per month.[2]
